    false,nt"url": null,nt"notes": "This narrative report for Aleutian Islands
    and Izembek NWRs outlines Refuge accomplishments from January through April of 1963.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments, collections and receipts, and prescribed burning.
    Resource management is outlined; topics include grazing. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, violations, and safety. N-R forms are attached.",nt"license_title":
